var animations = (function(){

  var init = function(){

    if($('.index').length){
      indexAnimations();
    }
    else{
      $('.header').addClass('animated');
      pageAnimations();
    }

    if($('.js-light').length){
      $('.header').addClass('-index');
    }

    $('.page').addClass('animated');

    var screenHeight = $(window).height();

    $('.js-fade').each(function(index, element){
      var $el = $(element);
      var waypoint = new Waypoint({
        element: $el,
        handler: function(direction) {
          $el.addClass('faded');
        },
        offset: screenHeight - 150
      })
    });

    var waypointBg = new Waypoint({
      element: $('.page_content'),
      handler: function(direction) {
        if(direction == 'down'){
          $('.page_headline-bg').css('position', 'absolute');
        }
        if(direction == 'up'){
          $('.page_headline-bg').css('position', 'fixed');
        }
      },
      offset: 0
    })
  };

  var pageAnimations = function(){
    if(!detectIE()){
      var parallaxPageBg = new ScrollMagic.Controller({globalSceneOptions: {triggerHook: "onEnter", duration:  '200%'}});
      new ScrollMagic.Scene({triggerElement: ".js-parallax"})
        .setTween(".js-parallax div", {y: 0, ease: Linear.easeNone})
        .addTo(parallaxPageBg);
    }

    var parallaxLetters = new ScrollMagic.Controller({globalSceneOptions: {triggerHook: "onEnter", duration:  '200%'}});
    new ScrollMagic.Scene({triggerElement: ".page_bg-text"})
      .setTween(".page_bg-text", {y: 100, ease: Linear.easeNone})
      .addTo(parallaxLetters);

    var controllerBg = new ScrollMagic.Controller({globalSceneOptions: {triggerHook: "onEnter", duration: "100%"}});
    new ScrollMagic.Scene({triggerElement: ".page_content.opacity"})
      .setTween(".page_content.opacity", {backgroundColor: 'rgba(255,255,255,1)', ease: Linear.easeNone})
      .addTo(controllerBg);
  };

  var indexAnimations = function(){
    $('.index_headline').addClass('animated');
    $('.header').addClass('index-animated');

    if(!detectIE()){
      var controllerMainBg = new ScrollMagic.Controller({globalSceneOptions: {triggerHook: "onEnter", duration: "100%"}});
      new ScrollMagic.Scene({triggerElement: ".index_info"})
        .setTween(".index_headline-bg", {alpha: 0, ease: Linear.easeNone})
        .addTo(controllerMainBg);

      var controllerMainLogo = new ScrollMagic.Controller({globalSceneOptions: {triggerHook: "onEnter", duration: "100%"}});
      new ScrollMagic.Scene({triggerElement: ".index_info"})
        .setTween(".index_headline-content-wrapper", {alpha: 0, y: -400, ease: Linear.easeNone})
        .addTo(controllerMainBg);
    }

    var controllerInfoBg = new ScrollMagic.Controller({globalSceneOptions: {triggerHook: "onLeave", duration: "100%"}});
    new ScrollMagic.Scene({triggerElement: ".index_headline"})
      .setTween(".index_info-bg", {alpha: 1, ease: Linear.easeNone})
      .addTo(controllerMainBg);

    var controllerProjectsBg = new ScrollMagic.Controller({globalSceneOptions: {triggerHook: "onEnter", duration: $('.index_projects').innerHeight()}});
    new ScrollMagic.Scene({triggerElement: ".index_projects"})
      .setTween(".index_projects-bg", {left: "-95%", ease: Linear.easeNone})
      .addTo(controllerProjectsBg);

    var parallaxTeamBg = new ScrollMagic.Controller({globalSceneOptions: {triggerHook: "onEnter", duration:  $('.index_team').innerHeight() * 2}});
    new ScrollMagic.Scene({triggerElement: ".index_team"})
      .setTween(".index_team-bg", {y: 300, ease: Linear.easeNone})
      .addTo(parallaxTeamBg);

    var parallaxMapBg = new ScrollMagic.Controller({globalSceneOptions: {triggerHook: "onEnter", duration:  $('.index_map').innerHeight() + 200}});
    new ScrollMagic.Scene({triggerElement: ".index_map"})
      .setTween(".index_map-bg", {y: 50, ease: Linear.easeNone})
      .addTo(parallaxMapBg);
  };

  return {
    init : init
  };

})();

var filters = (function(){

  var init = function(){
    mainFilters();
    selectFilter();
  };

  var directions = 'all';
  var industries = 'all';
  var main = 'all';

  var mainFilters = function(){
    $('.page_filter-title').each(function(index, element){
      var $el = $(element);
      $el.click(function(){
        $el.addClass('active').siblings().removeClass('active');
        main = $el.data('type');
        if($el.hasClass('js-project')){
          sendProjects(main, directions, industries);
        }
        else{
          $.ajax({
             type: "POST",
             url: '/filter_news/',
             data: { 'data' : main },
             success: function(response){
               if(response.error){
                 console.log('Oups!');
                 return false;
               }
               var content = $($.trim(response));
               $('.js-projects-items').html(content);
             },
             error: function(data){

             }
          });
        }
      });
    });
  };

  var selectFilter = function(){
    $('select.page_filter-select').each(function(index, element){
      var $el = $(element);
      $el.change(function(){
        if($el.hasClass('js-direct')){
          directions = $el.val();
          if(directions == 'all'){
            main = 'all';
          }
          if(directions == 'actives'){
            directions = 'all';
            main = 'active';
          }
          else{
            main = 'all';
          }
          $('.page_filter-select.js-industry').val('all').trigger('change');
        }
        if($el.hasClass('js-industry')){
          industries = $el.val();
        }
        sendProjects(main, directions, industries);
      });
    });
  };

  var sendProjects = function(main, directions, industries){
    var lang = $('.header').data('lang');
    $.ajax({
       type: "POST",
       url: '/filter_projects/',
       data: { 'data' : main, 'directions' : directions, 'industries' : industries, 'language': lang },
       success: function(response){
         if(response.error){
           console.log('Oups!');
           return false;
         }
         var content = $($.trim(response));
         $('.js-projects-items').html(content);
       },
       error: function(data){

       }
    });
  }

  return {
    init : init
  };

})();

var map = (function(){

  var init = function(){
    var width = $(document).width();
    ymaps.ready(function(){
      var lat = $('#map').data('lat') || 55.746715;
      var lng = $('#map').data('lng') || 37.536897;

      var map = new ymaps.Map("map", {
          center: [lat, lng],
          zoom: 17,
          controls: [],
      });
      map.behaviors
        .disable(['scrollZoom']);
      var placemark = new ymaps.Placemark([lat, lng], {}, {
          iconLayout: 'default#image',
          iconImageHref: document.getElementById('map').getAttribute('data-icon'),
          iconImageSize: [86, 108],
          iconImageOffset: [-35.5,-117]
      });
      map.geoObjects.add(placemark);
      var position = map.getGlobalPixelCenter();
      if (width >= 900) {
        map.setGlobalPixelCenter([ position[0] + 300, position[1] - 100]);
      }
      else if(width > 640 && width < 900){
        map.setGlobalPixelCenter([ position[0] + 250, position[1] + 0]);
      }
      else{
        map.setGlobalPixelCenter([ position[0] + 0, position[1] + 0]);
      }
    });
  };

  return {
    init : init
  };

})();

var popups = (function(){

  var self = {};

  var init = function(){
    self.triggers = $('.js-trigger');
    self.popups = $('.js-popup');
    self.body = $('html, body');
    self.bodyStyle = {};
    self.scrollTop = 0;
    self.ios = !!navigator.platform && /iPad|iPhone|iPod/.test(navigator.platform);

    initTriggers();
  };

  var popupShow = function(popup){
    popup.fadeIn(500);
    if((device.mobile() || device.tablet()) && self.ios){
      self.bodyStyle = document.body.style;
      self.scrollTop = {
          obj : document.documentElement.scrollTop === 0 ? document.body : document.documentElement,
          scrollTop: document.documentElement.scrollTop === 0 ? document.body.scrollTop : document.documentElement.scrollTop,
      }
      popup.css('position', 'absolute');
      document.body.style.overflow = 'hidden';
      document.body.style.height = '100%';
      document.body.style.width = '100%';
      document.body.style.position = 'fixed';
    }
    else{
      self.body.addClass('-opened-popup');
    }
  };

  var popupClose = function(popup){
    popup.fadeOut(300);
    if((device.mobile() || device.tablet()) && self.ios){
        document.body.style=self.bodyStyle;
        self.scrollTop.obj.scrollTop = self.scrollTop.scrollTop;
    }
    if($('.form-popup').length){
      var $form = $('#form_resume');
      $form[0].reset();
      $('.submit_button').attr('disabled', false);
      $form.find('.popup_input-file').removeClass('draged loaded');
      $form.find('input').removeClass('error');
      $('.popup_form-error').hide();
    }
    self.body.removeClass('-opened-popup');
  };

  var initTriggers = function(){
    self.triggers.each(function(index, element){
      var $el = $(element);
      $el.click(function(){
        var data = $el.data('popup');

        var popup  = self.popups.filter(function(){
          return $(this).data('popup') == data;
        });

        popupShow(popup);
        popup.find('.js-close').click(function(e){
          popupClose(popup);
        });

        popup.find('.js-content').click(function(e){
          e.stopPropagation();
          return;
        });

        if(data == 'form'){
          popup.find('form').data('type', $el.data('type'));
        }
      });
    });
  };

  return {
    init : init
  };

})();

var resume = (function(){

  var file;

  var init = function(){
    drag();
    sendForm();
  };

  var sendForm = function(){
    $('#form_resume').submit(function(e){
      e.preventDefault();
      $('.submit_button').attr('disabled', true);
      ajaxData = new FormData($(this)[0]);
      if($(this).find('input.error').length){
        $('.submit_button').attr('disabled', false);
        $('.popup_form-error').show();
        return false;
      }
      else{
        $('.popup_form-error').hide();
      }
      ajaxData.set('type', $(this).data('type'));
      if(file){
        ajaxData.set('file', file);
      }

      $.ajax({
         type: "POST",
         url: '/send_resume/',
         data: ajaxData,
         cache: false,
         contentType: false,
         enctype: 'multipart/form-data',
         processData: false,
         success: function(data){
           if(data.result == 'ok'){
             $('.form_ok').trigger('click');
             $('.form-popup .js-close').trigger('click');
           }
         },
         error: function(data){
           alert('Упс. Что-то пошло не так.');
         }
      });
    });
  }

  var drag = function(){
    var $block = $('.popup_input-file');

    $block.change(function(e){
      var filename = $block.val().split('\\').pop();
      $('.popup_result .popup_file-title').text(filename);
      $(this).removeClass('draged').addClass('loaded');
    });

    $block.on('dragenter', function (e){
      e.preventDefault();
      $(this).addClass('draged');
    });

    $block.on('dragleave', function (e){
      e.preventDefault();
      $(this).removeClass('draged');
    });

    $block.on('dragover', function (e){
      e.preventDefault();
    });

    $block.on('drop dragdrop', function (e){
      e.preventDefault();
      $(this).removeClass('draged').addClass('loaded');
      var resume = e.originalEvent.dataTransfer.files;
      file = resume[0];
      $('.popup_result .popup_file-title').text(resume[0].name);
    });

    $('.popup_file-reset').click(function(){
      file = '';
      $block.removeClass('draged loaded');
      $('.popup_result .popup_file-title').text('');
    });
  }

  return {
    init : init
  };

})();

var search = (function(){

  var init = function(){
    var $icon = $('.page_filters_search-icon');
    var $input = $('.page_filters_search-input');

    $icon.click(function(e){
      e.stopPropagation();
      $icon.addClass('opened');
      $input.fadeIn().focus();
    });

    $input.blur(function(){
      $input.fadeOut().val('');
      $icon.removeClass('opened');
    });

    $input.parent('form').submit(function(e){
      e.preventDefault();
      var val = $input.val();
      if($input.hasClass('js-news')){
        var type = 'news';
      }
      else{
        var type = 'projects';
      }
      if(val){
        window.location.href = '/search?type='+ type +'&search=' + val;
      }
      else{
        $input.trigger('blur');
      }
    });
  };

  return {
    init : init
  };

})();

$(window).ready(function () {
  (function (w) {
    function createWindow(url) {
      var width = 800;
      var height = 500;
      var top = Math.round(screen.height / 3 - height / 2);
      var left = Math.round(screen.width / 2 - width / 2);
      return window.open(url, '', 'left=' + left + ',top=' + top + ',width=' + width + ',height=' + height + ',personalbar=0,toolbar=0,scrollbars=1,resizable=1');
    }

    function share(network, share) {
      var defaultValues = { url: '', title: '', image: '', text: '' };
      var _extend = $.extend(defaultValues, share);

      var url = _extend.url;
      var title = _extend.title;
      var image = _extend.image;
      var text = _extend.text;

      url = encodeURIComponent(url);

      createWindow({
        ok: 'https://odnoklassniki.ru/dk?st.cmd=addShare&st.s=1&st.comments=' + text + '&st._surl=' + url,
        vk: 'https://vk.com/share.php?url=' + url + '&title=' + title + '&image=' + image + '&description=' + text,
        tw: 'https://twitter.com/intent/tweet?url=' + url + '&text=' + text,
        fb: 'https://www.facebook.com/sharer/sharer.php?u=' + url
      }[network]);
    }

    w.share = share;


    $('.socials_item').click(function(e){
      e.stopPropagation();
      var data = $(this).data('sharing');
      var id = $(this).data('id');

      share(data, {
        url: 'http://' + window.location.hostname + '/news/' + id
      });

    });
  }(window));
});

$(document).ready(function() {
  $('.page_filter-select').styler({
    selectSmartPositioning: false
  });
  $('.popup_form').validate({
    errorPlacement: function(error,element) {
      return true;
    }
  });

  $('.preloader').fadeOut();

  (function(){
    var $form = $('.language');
    var $input = $form.find('input.js-lang');

    $('.js-change-lang').click(function(){
      if($(this).hasClass('-active')) return false;
      var lang = $(this).data('lang');
      $input.val(lang);
      $form.submit();
    });
  })();

  resume.init();
  popups.init();
  filters.init();
  search.init();

  if($('.index').length){
    if(!detectIE()){
      $('.index_headline-logo').addClass('not-ie');
    }
    else{
      $('.index_headline').addClass('ie');
    }
  }

  if(detectIE()){
    $('.page_content').addClass('ie');
  }

  if(device.mobile() || device.tablet()){

  }
  else{
    animations.init();
  }



  var $header = $('.header');

  $(document).mousewheel(function(event) {
    if(event.deltaY > 0){
      $header.addClass('showed');
      if(!$header.hasClass('fixed')){
        $header.removeClass('-light');
        if(!$('.js-header-show').hasClass('added')){
          $header.addClass('-index');
        }
      }
    }
    if(event.deltaY < 0){
      if($header.hasClass('fixed')){
        setTimeout(function(){
            $header.removeClass('showed');
        }, 500);
      }
    }
  });

  var headerWaypoint = new Waypoint({
    element: $('.js-header-show'),
    handler: function(direction) {
      if(direction == 'down'){
        $header.addClass('fixed');
        $header.removeClass('index-animated animated showed');
      }
      if(direction == 'up'){
        $header.removeClass('fixed -light');
      }
    },
    offset: 60
  })

  $('.js-waypoint').each(function(index, element){
    var $el = $(element);
    var waypoint = new Waypoint({
      element: $el,
      handler: function(direction) {
        if(direction == 'down'){
          if($el.hasClass('lights')){
            $header.addClass('-light');
            $header.removeClass('-index');
          }
          if($el.hasClass('darks')){
            $header.removeClass('-light');
            $header.removeClass('-index');

          }
          if($el.hasClass('main')){
            $header.removeClass('-light');
          }
        }
        if(direction == 'up'){
          if(!$el.hasClass('lights')){
            $header.addClass('-light');
            $header.removeClass('-index');
          }
          if(!$el.hasClass('darks')){
            $header.removeClass('-light');
            $header.removeClass('-index');
          }
          if($el.hasClass('main')){
            $header.removeClass('-light');
            $header.addClass('-index');
          }
        }
      },
      offset: 135
    })
  });


});
